import Highlight from '../Highlight';

export default function Hero() {

  const code = `

    @import '_variables';

    html {
    }

    html,
    body {
      color: $color-text;
      height: 100%;
      padding: 0;
      margin: 0;
    }

    body {
      background-color: $color-background;
      background-attachment: fixed;
      background-blend-mode: overlay;
      background-size: cover;
      // background-position: -5rem;
      // background-position: bottom;
      background-position: center;
      // background-position: top;
      background-image: url('/_backgrounds/_raw/space-01.jpg');
      // background-image: url('/_backgrounds/_raw/space-02.jpg');
      // background-image: url('/_ backgrounds/_raw/mountain-01.jpg');
      // background-image: url('/_backgrounds/_raw/light.jpg');
      // background-image: url('/_backgrounds/_raw/dj.jpg');
      // background-image: url('/_backgrounds/_raw/fog-01.jpg');
      // background-image: url('/_backgrounds/_raw/seti-01.jpg');
    }

    * {
      box-sizing: border-box;
    }


  `;
  return (
    <div className="code-sample"> 
      <Highlight language="css" content={code} header="CSS" />
    </div>
  )
}
